import * as React from 'react';
import { styled } from '../stitches.config';

const GameHeader: React.FC = ({ children }) =>
  (<Header>{children}</Header>);

export default GameHeader;

const Header = styled('div', {
  width: '100%',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'space-between',
  minHeight: 44.8,
});
